script: |
  super -f text -I q3304.spq | sort > q3304.out

inputs:
  - name: q3304.spq
    data: |
      SELECT DISTINCT + + 85, - ( - col2 ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 15 * + col2 + 35 IS NULL;
  - name: tab1

outputs:
  - name: q3304.out
    data: |
      85	59
      85	68
      85	96
